import Action from "./Action"

function Footer(){
    const actions = [
        {url:'/Icons/Footer/home.png', text:'Résumé'}, 
        {url:'/Icons/Footer/carnet.png', text:'Carnet & Pass+'},
        {url:'/Icons/Footer/info.png', text:'Actualités'}
    ]
    return(
        <footer>
            {
                actions.map(curAct => {
                    return (
                        <>
                            <Action key={curAct.text} actionData = {curAct}></Action>
                            <div></div>
                        </>
                    )
                })
            }
        </footer>
    )
}

export default Footer
